function log(n){DEVELOPMENT&&console.log(`%c[Log] ${n}`,"color: #00a2ff;")}function error(n){console.error(n)}function distance(n,t,e,o){var r=n-t,c=e-o;return Math.sqrt(r*r+c*c)}function random(n,t){return Math.floor(Math.random()*(t-n)+n)}function checkIntersection(n,t,e,o,r,c,i,a){return t>=e&&n<=o&&r<=a&&c>=i}function timestamp(){return(new Date).getTime()/1e3}function mtimestamp(){return(new Date).getTime()}
